import React from 'react';

const Register = ({ user }) => {
   if (user.admin === true) {
    return (
        <div>
            <p>Register</p>
        </div>
    )
   } else {
        <div>
            <p>You do not have access to this part of the site</p>
        </div>
   }
}

export default Register;
